import React, { useState } from 'react';
import { TextField, Button, Table, TableHead, TableBody, TableCell, TableRow } from '@mui/material';

function App() {
  const [value, setValue] = useState('');
  const [notes, setNotes] = useState([]);

  const handleClick = () => {
    setNotes([...notes, value]);
    setValue('');
  };

  const handleChange = (e) => {
    setValue(e.target.value);
  };

  return (
    <>
      <TextField
        label="Note"
        variant="outlined"
        value={value}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <Button variant="contained" color="primary" onClick={handleClick}>
        Add Note
      </Button>

      <Table>
        <TableHead>
          <TableRow>
            <TableCell style={{ borderBottom: '1px solid #e0e0e0' }}>ID</TableCell>
            <TableCell style={{ borderBottom: '1px solid #e0e0e0' }}>Value</TableCell>
          </TableRow>
        </TableHead>

        <TableBody>
          {notes.map((row, index) => (
            <TableRow key={index}>
              <TableCell style={{ borderBottom: '1px solid #e0e0e0' }}>{index}</TableCell>
              <TableCell style={{ borderBottom: '1px solid #e0e0e0' }}>{row}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </>
  );
}

export default App;
